import React from 'react';
import { Switch, Route } from 'react-router-dom';

import Dashboard from '../pages/Dashboard';
import Repository from '../pages/Repository';
import AdminRepository from '../pages/AdminRepository';

const Routes: React.FC = () => (
  <Switch>
    <Route path="/trybe-projects" exact component={Dashboard} />
    <Route path="/trybe-projects/repository/:repository+" component={Repository} />
    <Route path="/trybe-projects/repository/:repository/admin+" component={AdminRepository} />
  </Switch>
);

export default Routes;
